import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-scroll';

const LogoContainer = styled(Link)`
  display: flex;
  align-items: center;
  gap: 0.5rem;
  cursor: pointer;
`;

const LogoIcon = styled.div`
  svg {
    width: 32px;
    height: 40px;
    overflow: visible;
  }
`;

const LogoText = styled.span`
  font-family: var(--font-heading);
  font-weight: 700;
  font-size: 1.5rem;
  color: var(--color-text);
`;

const Logo = () => {
  return (
    <LogoContainer to="hero" smooth={true} duration={500}>
      <LogoIcon>
        <svg xmlns="http://www.w3.org/2000/svg" width="24" height="32" viewBox="0 0 24 32" fill="none">
          <path
            d="M20 10C20 14.4183 12 19 12 19C12 19 4 14.4183 4 10C4 7.79086 5.79086 6 8 6C9.86384 6 11.4299 7.27477 12 9C12.5701 7.27477 14.1362 6 16 6C18.2091 6 20 7.79086 20 10Z"
            stroke="#FF6B35"
            strokeWidth="2"
            strokeLinecap="round"
            strokeLinejoin="round"
          />
          <path
            d="M16 6C14.1362 6 12.5701 7.27477 12 9C11.4299 7.27477 9.86384 6 8 6C5.79086 6 4 7.79086 4 10C4 14.4183 12 19 12 19"
            stroke="#FF6B35"
            strokeWidth="2"
            strokeLinecap="round"
            strokeLinejoin="round"
          />
          <circle cx="20" cy="24" r="2" stroke="#FF6B35" strokeWidth="2"/>
          <path
            d="M20 26V30"
            stroke="#FF6B35"
            strokeWidth="2"
            strokeLinecap="round"
          />
        </svg>
      </LogoIcon>
      <LogoText>HomeNurse</LogoText>
    </LogoContainer>
  );
};

export default Logo;
